import React from 'react'
import "./style.css";
const Restaurant = () => {
  return (
    <>
      <div className="card-container">
          <div className="card">
              <div className="card-body">
                 <span className="card-number card-circle subtle">1</span>
                 <span className="card-author subtle">
                    Breakfast
                 </span>
                 <h2 card></h2>
              </div>
          </div>
      </div>
    </>
  );
};

export default Restaurant;
